import React from 'react'
import { useParams } from 'react-router-dom'

export default function Detail() {

    const {id,title,context} = useParams();
    
    return (
        <div>
            <ul>
                <li>{id}</li>
                <li>{title}</li>
                <li>{}</li>
            </ul>
        </div>
    )



}
